import React from 'react'
import Appbar from '../surface/Appbar'
import uccplogo from '../assets/uccplogo.png';
import schlogo from '../assets/schlogo.png';

function Dashboard() {
  return (  
    <div>
      <Appbar/>
    <div>
      <img src="schlogo" alt="" className='h-20 w-20 justify-center'/>
    </div>
    </div>
  )
}

export default Dashboard
